  return (
    <Container>
      <Style>
        <div className="body">
          <h1 className="bodyTitle">О нас</h1>
          <div className="d-flex justify-content-center">
            <p className="bodySubTitle1">Главная</p>
            <hr />
            <p className="bodySubTitle2">О нас</p>
